graphql.query:
query doctors {
      doctors(first: 108) {
        data {
            doctor_id: id
            specializations {
                name
            }
            doctorUser {
                user_id: id 
                username: full_name
                first_name
                last_name
                photo: profile_image
            }
        }
        paginatorInfo {
          total
          currentPage
          hasMorePages
        }
      }
    }

query {
  appointmentsbydoctor(doctor_id: "1") {
    id
    appointment_unique_id
    doctor {
      doctor_id: id
      doctorUser {
        user_id: id
        username: full_name
        first_name
        last_name
        photo: profile_image
      }
    }
    description
    status
    date
    from_time
    from_time_type
    to_time
    to_time_type
    room_data
  }
}

query {
  sessionsBydoctorId(doctor_id: 14) {
    id
    doctor_id
    doctor {
      doctor_id: id
      doctorUser {
        user_id: id
        username: full_name
        first_name
        last_name
        photo: profile_image
      }
    }
    session_meeting_time
    session_gap
    sessionWeekDays {
            day_of_week
            start_time
            start_time_type
            end_time
            end_time_type

        }


  }
}

